reviewContent:
일요일에 주문 했는데 월요일 아침에 도착 했어요.
이렇게 빠른 택배는 첨이라&hellip; 그저 놀라움에 감탄&hellip;
새해가 되어 한 살 더 먹으니까 건강 생각해서 저희 부부 영양제랑 아이들 영양제까지 요즘 계속 주문하고 있어요. 요즘 눈이 많이 침침해 답답 했는데 마침 특가로 떠서 주문해서 먹었는데 효과 있길 바래요. 다른 영양제도 주문해서 기다리고 있어요. 올 해는 좀 더 건강 했으면 좋겠어요.

타 마켓보다 좀 더 비싸게 구매했네요.  ㅎㅎ;;
유통기한 23년9월로 넉넉하구요.
포장상태는 좋아요.

루테인은 처음이에요
오메가 포함되서 흡수가 더 잘듯해요
근데 알이너무커요^^;;

배송 엄청빠르네요;;
아직안먹어봤지만 먹고 좋아지면
좋겠어요

아직 먹기전이지만 평이좋아 구매해봤어요ㅎ
꾸준히 먹으면 효과를 보겠쥬..?ㅎ
많이 파세용(ฅ&rsquo;&omega;&rsquo;ฅ)&hearts;
